import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
// import Image from 'react-bootstrap/Image';
import headshot from '../../images/jeff-berlin-landing-background-min.jpg';

function Landing() {
  return (
  <div style={{ backgroundColor: '#4f4f4f'}}>
    <Container fluid className='landing' style={{ paddingTop: '64px', paddingBottom: '1rem', height: '100vh', backgroundImage: `url(${headshot})`, backgroundSize: 'cover', backgroundPosition: 'center', backgroundRepeat: 'no-repeat'}}>
      <Row style={{ marginTop: '60vh'}}>
        <Col xl={6} lg={6} md={8} sm={8} style={{ paddingLeft: '0'}}>
          <div style={{ padding: '20px', backgroundColor: '#4f4f4f', border: '1px solid rgba(0, 0, 0, 0.7)',
boxShadow: '4px 4px 4px 1px #B89000'}}>
            <h1 style={{ color: '#fff' }}>Jeff Berlin</h1>
            <h2 style={{ color: 'rgba(255, 255, 255, .6)', fontSize: '1.5rem' }}>UI/UX Developer & Designer</h2>
            <p style={{ color: '#fff' }}>I am a highly motivated UI/UX Developer and Designer that loves learning and problem solving. Racing cars, snowboarding, and playing ice hockey just help to pass the time.</p>
            <button style={{}}>Contact Me</button>
          </div>
        </Col>
      </Row>
    </Container>
    </div>
  );
}

export default Landing;
